USE [WeatherApp]

CREATE TABLE [dbo].[Countries] (
	[Id] INT NOT NULL IDENTITY(1,1)
		CONSTRAINT PK_Countries PRIMARY KEY
	,[Name] NVARCHAR(200) NOT NULL
		CONSTRAINT UQ_Countries_Name UNIQUE
	,INDEX IDX_Countries NONCLUSTERED ([Name])
)

CREATE TABLE [dbo].[Cities] (
	[Id] INT NOT NULL IDENTITY(1,1)
		CONSTRAINT PK_Cities PRIMARY KEY
	,[CountryId] INT NOT NULL
		CONSTRAINT FK_Cities_Countries
		REFERENCES [dbo].[Countries]
	,[Name] NVARCHAR(200) NOT NULL
	,CONSTRAINT UQ_Cities 
		UNIQUE ([CountryId], [Name])
	,INDEX IDX_City_Name 
		NONCLUSTERED ([Name])
)
GO

CREATE PROCEDURE [dbo].[usp_AddCityAndCountry]
	@city NVARCHAR(200)
	,@country NVARCHAR(200)
AS BEGIN
	DECLARE @countryId INT
	DECLARE @cityId INT

	SELECT @countryId = [Id]
	FROM [dbo].[Countries]
	WHERE [Name] = @country

	IF @countryId IS NULL
	BEGIN
		INSERT INTO [dbo].[Countries]
		    (
		        [Name]
		    )
		VALUES
		    (
		        @country -- Name - nvarchar(200)
		    )

		SET @countryId = SCOPE_IDENTITY()
	END

	SELECT @cityId = [Id]
	FROM [dbo].[Cities]
	WHERE [Name] = @country

	IF @cityId IS NULL
	BEGIN
		INSERT INTO [dbo].[Cities]
		    (
		        [CountryId],
		        [Name]
		    )
		VALUES
		    (
		        @countryId,  -- CountryId - int
		        @city -- Name - nvarchar(200)
		    )
	END
END
GO

